export const consultaDados = async (nomeArquivo) => {
  try {
    const response = await fetch(`/dados/${nomeArquivo}`);
    const dados = await response.json();
    return dados;
  } catch (error) {
    console.error("Erro ao buscar dados: ", error);
    return null;
  }
};
